package leetcode;

public class Sort_Characters_By_Frequency_451 {

	public String frequencySort(String s) {
		long time1=System.currentTimeMillis();       
		int[] map=new int[128];
		char[] chars=s.toCharArray();
		int max=0;
		for(int i=0;i<chars.length;i++){
			map[chars[i]]++;
			max=map[chars[i]]>max?map[chars[i]]:max;
		}
		long time2=System.currentTimeMillis();
		String[] bucket=new String[max+1];
		for(int i=0;i<128;i++){
			int num=map[i];
			if(num>0){
				if(bucket[num]==null){
					bucket[num]=(char)i+"";
				}
				else{
					bucket[num]=bucket[num]+(char)i;
				}
			}		
		}
		long time3=System.currentTimeMillis();
		StringBuffer sb=new StringBuffer();
		for(int i=max;i>=1;i--){			
			if(bucket[i]!=null){
				char[] thisChars=bucket[i].toCharArray();
				for(int j=0;j<thisChars.length;j++){
					for(int k=0;k<i;k++){
						sb.append(thisChars[j]);
					}
				}			
			}
			
		}
		long time4=System.currentTimeMillis();
        float excTime1=(float)(time2-time1)/1000;
        float excTime2=(float)(time3-time2)/1000;
        float excTime3=(float)(time4-time3)/1000;
	    System.out.println("执行时间1："+excTime1+"s");
	    System.out.println("执行时间2："+excTime2+"s");
	    System.out.println("执行时间3："+excTime3+"s");
		return sb.toString();
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Sort_Characters_By_Frequency_451 s=new Sort_Characters_By_Frequency_451();
		System.out.println(s.frequencySort(""));
	}

}
